import React, { useEffect, useState } from "react";
import { getCash } from "./CashApi"; // Ensure this is the correct path

const Cash = () => {
  const [cashData, setCashData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCashData = async () => {
      try {
        const data = await getCash();
        if (data && typeof data === "object" && !Array.isArray(data)) {
          setCashData(data);
        } else {
          console.warn("Expected an object but got:", data);
          setCashData(null);
        }
      } catch (error) {
        setError("Error fetching cash data");
        console.error("Error fetching cash data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchCashData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  if (!cashData) return <p>No cash data available</p>;

  return (
    <div>
      <h1>Cash Data</h1>
      <table className="cash-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Entry Date</th>
            <th>Initial Cash</th>
            <th>Available Cash</th>
            <th>Cash Balance</th>
            <th>Net PNL</th>
            <th>User ID</th>
          </tr>
        </thead>
        <tbody>
          <tr key={cashData.id}>
            <td>{cashData.id}</td>
            <td>{cashData.entry_date}</td>
            <td>{cashData.initial_cash}</td>
            <td>{cashData.available_cash}</td>
            <td>{cashData.cash_balance}</td>
            <td>{cashData.net_pnl}</td>
            <td>{cashData.user_id}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Cash;
